import React from 'react';
import { connect } from 'react-redux';
import { fetchMovements } from '../actions';
import { MuiThemeProvider } from '@material-ui/core/styles';
import { createMuiTheme } from '@material-ui/core/styles';
import PropTypes from 'prop-types';

const InputTheme = createMuiTheme({
    HomePageTitle: {
        display: 'flex',
        justifyContent: 'center'
    }
});

class MovementsList extends React.Component {
    componentDidMount() {
        this.props.fetchMovements();
    }

    render() {
        const { classes } = this.props;
        return (
            <MuiThemeProvider theme={InputTheme}>
                 <div className={classes.HomePageTitle}>Listed Movements:</div>
            </MuiThemeProvider>
        )
    }
}

MovementsList.propTypes = {
    classes: PropTypes.object.isRequired,
};

const mapStateToProps = (state) => {
    return { move: Object.values(state.move) };
}

export default connect(mapStateToProps, { fetchMovements })(MovementsList);
